            "listing": {
              "name": "Custom Fields",
              "locale": "en-US",
              "description": "Custom data fields for Trello cards.\n\nEver want to add a dropdown menu, checkbox, or additional date fields to Trello cards? The Custom Fields Power-Up let’s you do all that and more, bringing process and formality to your workflow to meet your team’s unique needs. Whether it’s number fields to track feature requests, additional date fields for start and end dates of marketing campaigns, dropdown menus of SKUs to manage orders from customers, and more, Custom Fields has you covered. Plus, field data is surfaced to the front of Trello cards for information in a glance.\n\n- Custom fields for text, numbers, checkboxes, dates, and dropdown lists.\n- Display field data as card badges on the front of cards.\n- Field names support emoji for extra visual appeal.\n- Custom Fields are supported on mobile devices.\n- Export Custom Fields data in JSON and CSV board exports. *Note: CSV exports are only available on Business Class and Enterprise teams.*\n\n![screenshot](https://card-fields.trello.services/images/custom-fields-1.jpg)\n![screenshot](https://card-fields.trello.services/images/custom-fields-2.jpg)\n![screenshot](https://card-fields.trello.services/images/custom-fields-3.jpg)",
              "overview": "Add custom fields like text, numbers, checkboxes, dates, and dropdown lists to cards."
